  const Container = styled.div`
    padding-bottom: 1rem;
    overflow-x: auto;

  `;

  const Main = styled.div`
    height: 100%;
    margin-bottom: 2rem;
    `;


  return (
    <Container>
      <Main>
        <HomeMyStocksMainHeader />
        <HomeMyStocksInfo />









      </Main>

    </Container>
  )
}

export default HomeMyStocksMain
